import React, {FC} from 'react';
import '../styles/grid.css';

interface Props {
    key: string;
    title: string;
    data?: string[];
}

const Grid:FC<Props> = (props) => {
    return (
        <>
        <h1>
            {props.title}
        </h1>
            <div className="Grid-view" key={props.key}>
                <div className="Grid-desc">
                   {props.data?.map((i) => (
                       <p>{i}</p>
                   ))}
                </div>
            </div>
        </>
    );
}

export default Grid;
